    /**
     * @param $date
     * @param bool $asString
     * @return bool|int
     */
    static public function dayOfWeek($date,$asString=true){
        if (is_string($date))
            $date = self::parseDateStr($date);

        if (!is_array($date) || !isset($date['day']) || !isset($date['month']) || !isset($date['year']))
            return false; //throw new exception

        $dayOfWeek = intval( date('N', mktime(0,0,0,$date['month'],$date['day'],$date['year'])) );

        return $asString ? hicri::$dayOfWeeks[$dayOfWeek] : $dayOfWeek;
    }
    /**
     * @param $date
     * @param bool $resultType
     * @return array|bool|null|string
     */
    static public function hicriMiladi($date, $resultType = false)
    {

        if (is_string($date))
            $date = self::parseDateStr($date);

        if (!is_array($date) || !isset($date['day']) || !isset($date['month']) || !isset($date['year']))
            return false; //throw new exception


        $hicriStr = $date['year'].'-'.$date['month'].'-'.$date['day'];

        $hasCalculated = array_search($hicriStr,hicri::$calculated);


        if($hasCalculated){
            $miladiDate = self::parseDateStr($hasCalculated );
            $dayOfWeek = hicri::dayOfWeek($miladiDate);
            $result = ['date' => $miladiDate, 'hilal' => true, 'dow'=>$dayOfWeek];
        } else {

            $miladiDate = self::hicriMiladiOto($date);

            if(array_key_exists(date("Y-m-d", mktime(0, 0, 0, $miladiDate['month'], $miladiDate['day'], $miladiDate['year'])), hicri::$calculated)){
                return ['error'=>'Tarih geçersiz.'];
            }



            $dayOfWeek = hicri::dayOfWeek($miladiDate);
            $result = ['date' => $miladiDate, 'hilal' => false, 'dow'=>$dayOfWeek];


            if(array_key_exists(date("Y-m-d", mktime(0, 0, 0, $miladiDate['month'], $miladiDate['day'], $miladiDate['year'])), hicri::$calculated)){


                return false;
                //$result['error'] = 'Tarih geçersiz.';

                //return $result;
            }

        }

        //miladi tarihin geçerli bir tarih oldugundan emin ol
        $result['date'] = self::parseDateStr( date('Y-m-d', mktime(0,0,0,$result['date']['month'],$result['date']['day'],$result['date']['year'])) );

        if ($resultType == 'string')
            return self::miladiStr($result['date']);
        elseif (in_array($resultType, ['date', 'array']))
            return $result['date'];
        else
            return $result;
    }

    /**
     * @param $date
     * @return bool|float
     */
    static public function hicriMonthLength($date)
    {

        if (is_string($date))
            $date = self::parseDateStr($date);

        if (!is_array($date) || !isset($date['day']) || !isset($date['month']) || !isset($date['year']))
            return false; //throw new exception

        $aybasiHicri = $date;
        $aysonuHicri = $date;
        $aybasiHicri['day'] = 1;

        $aysonuHicri['day'] = 1;
        if (++$aysonuHicri['month'] > 12) {
            $aysonuHicri['month'] = 1;
            $aysonuHicri['year']++;
        }

        $aybasiMiladi = hicri::hicriMiladiOto($aybasiHicri);
        $aysonuMiladi = hicri::hicriMiladiOto($aysonuHicri);

        $aybasiHilal = hicri::hilalBul($aybasiMiladi);
        $aysonuHilal = hicri::hilalBul($aysonuMiladi);

        if ($aybasiHilal === false || $aysonuHilal === false) {
            //hilal olmadan kaç gün olduğu hesaplanamaz, otomatik hesaplat
            $aybasiHilalDate = mktime(0, 0, 0, $aybasiMiladi['month'], $aybasiMiladi['day'], $aybasiMiladi['year']);
            $aysonuHilalDate = mktime(0, 0, 0, $aysonuMiladi['month'], $aysonuMiladi['day'], $aysonuMiladi['year']);
            $result = floor(($aysonuHilalDate - $aybasiHilalDate) / 24 * 60 * 60);
            return $result;

        } else {
            $aybasiHilalDate = mktime(0, 0, 0, $aybasiHilal['month'], $aybasiHilal['day'], $aybasiHilal['year']);
            $aysonuHilalDate = mktime(0, 0, 0, $aysonuHilal['month'], $aysonuHilal['day'], $aysonuHilal['year']);
            $result = floor(($aysonuHilalDate - $aybasiHilalDate) / (24 * 60 * 60));
            return $result;
        }


    }

    /**
     * @param $date
     * @return null|string
     */
    static public function hicriStr($date)
    {
        if (is_string($date))
            $date = self::parseDateStr($date);

        if (!is_array($date) || !isset($date['day']) || !isset($date['month']) || !isset($date['year']))
            return null; //throw new exception

        return $date['day'] . ' ' . self::$hicriMonth[$date['month']] . ' ' . $date['year'];
    }

    /**
     * @param $date
     * @return null|string
     */
    static public function miladiStr($date)
    {
        if (is_string($date))
            $date = self::parseDateStr($date);

        if (!is_array($date) || !isset($date['day']) || !isset($date['month']) || !isset($date['year']))
            return null; //throw new exception

        return $date['day'] . ' ' . self::$miladiMonth[$date['month']] . ' ' . $date['year'];
    }

    /**
     * @param $date
     * @param string $resultType
     * @return array|bool|null|string
     */
    static public function miladiHicri($date, $resultType = 'default')
    {

        if (is_string($date))
            $date = self::parseDateStr($date);

        if (!is_array($date) || !isset($date['day']) || !isset($date['month']) || !isset($date['year']))
            return false; //throw new exception

        $hasCalculated = array_key_exists(date("Y-m-d", mktime(0, 0, 0, $date['month'], $date['day'], $date['year'])), hicri::$calculated);

        $dayOfWeek = hicri::dayOfWeek($date);

        if($hasCalculated){
            $hicridate = self::parseDateStr(hicri::$calculated[date("Y-m-d", mktime(0, 0, 0, $date['month'], $date['day'], $date['year']))] );
            $result = ['date' => $hicridate, 'hilal' => true, 'dow'=>$dayOfWeek];
        } else {

            $hicridate = self::miladiHicriOto($date);
            $result = ['date' => $hicridate, 'hilal' => false, 'dow'=>$dayOfWeek];
        }

        if ($resultType == 'string')
            return self::hicriStr($result['date']);
        elseif (in_array($resultType, ['date', 'array']))
            return $result['date'];
        else
            return $result;
    }

    /**
     * @param $date
     * @param int $scobe
     * @return array|bool
     */
    static public function hilalBul($date, $scobe = 0)
    {
        if (is_string($date))
            $date = self::parseDateStr($date);

        if (!is_array($date) || !isset($date['day']) || !isset($date['month']) || !isset($date['year']))
            return false; //throw new exception

        if ($scobe == 0) {
            $start = -3;
            $end = +3;
        } elseif ($scobe < 0) {
            $start = -3;
            $end = 0;
        } elseif ($scobe > 0) {
            $start = 0;
            $end = 3;
        } else {
            return false;
        }

        for ($i = $start; $i <= $end; $i++) {
            $newdate = mktime(0, 0, 0, $date['month'], $date['day'] + $i, $date['year']);
            $array[] = date('Y-m-d', $newdate);
        }

        foreach ($array as $val) {
            if (in_array($val, self::$hilals)) {
                return self::parseDateStr($val);
            }
        }

        return false;
    }

    /**
     * @param $date
     * @param bool $string
     * @return array|string
     */
    static public function hicriMiladiOto($date, $string = false)
    {
        $day = intval($date['day']);
        $month = intval($date['month']);
        $year = intval($date['year']);


        $jd = self::intPart((11 * $year + 3) / 30) + 354 * $year + 30 * $month - self::intPart(($month - 1) / 2) + $day + 1948440 - 385;

        if ($jd > 2299160) {
            $l = $jd + 68569;
            $n = self::intPart((4 * $l) / 146097);
            $l = $l - self::intPart((146097 * $n + 3) / 4);
            $i = self::intPart((4000 * ($l + 1)) / 1461001);
            $l = $l - self::intPart((1461 * $i) / 4) + 31;
            $j = self::intPart((80 * $l) / 2447);
            $day = $l - self::intPart((2447 * $j) / 80);
            $l = self::intPart($j / 11);
            $month = $j + 2 - 12 * $l;
            $year = 100 * ($n - 49) + $i + $l;
        } else {
            $j = $jd + 1402;
            $k = self::intPart(($j - 1) / 1461);
            $l = $j - 1461 * $k;
            $n = self::intPart(($l - 1) / 365) - self::intPart($l / 1461);
            $i = $l - 365 * $n + 30;
            $j = self::intPart((80 * $i) / 2447);
            $day = $i - self::intPart((2447 * $j) / 80);
            $i = self::intPart($j / 11);
            $month = $j + 2 - 12 * $i;
            $year = 4 * $k + $n + $i - 4716;
        }

        $date2 = array();
        $date2['year'] = $year;
        $date2['month'] = $month;
        $date2['day'] = $day;

        if (!$string)
            return $date2;
        else
            return "{$year}-{$month}-{$day}";
    }

    /**
     * @param $date
     * @param bool $string
     * @return array|string
     */
    static public function miladiHicriOto($date, $string = false)
    {
        $day = intval($date['day']);
        $month = intval($date['month']);
        $year = intval($date['year']);

        if (($year > 1582) or (($year == 1582) and ($month > 10)) or (($year == 1582) and ($month == 10) and ($day > 14))) {
            $jd = self::intPart((1461 * ($year + 4800 + self::intPart(($month - 14) / 12))) / 4) + self::intPart((367 * ($month - 2 - 12 * (self::intPart(($month - 14) / 12)))) / 12) -
                self::intPart((3 * (self::intPart(($year + 4900 + self::intPart(($month - 14) / 12)) / 100))) / 4) + $day - 32075;
        } else {
            $jd = 367 * $year - self::intPart((7 * ($year + 5001 + self::intPart(($month - 9) / 7))) / 4) + self::intPart((275 * $month) / 9) + $day + 1729777;
        }

        $l = $jd - 1948440 + 10632;
        $n = self::intPart(($l - 1) / 10631);
        $l = $l - 10631 * $n + 354;
        $j = (self::intPart((10985 - $l) / 5316)) * (self::intPart((50 * $l) / 17719)) + (self::intPart($l / 5670)) * (self::intPart((43 * $l) / 15238));
        $l = $l - (self::intPart((30 - $j) / 15)) * (self::intPart((17719 * $j) / 50)) - (self::intPart($j / 16)) * (self::intPart((15238 * $j) / 43)) + 29;

        $month = self::intPart((24 * $l) / 709);
        $day = $l - self::intPart((709 * $month) / 24);
        $year = 30 * $n + $j - 30;

        $date = array();
        $date['year'] = $year;
        $date['month'] = $month;
        $date['day'] = $day;

        $hicriaylar = [1 => "Muharrem",
            2 => "Safer",
            3 => "Rebîü'l-Evvel",
            4 => "Rebîü'l-Âhir",
            5 => "Cemâziye'l-Evvel",
            6 => "Cemâziye'l-Âhir",
            7 => "Recep",
            8 => "Şa'bân",
            9 => "Ramazan",
            10 => "Şevvâl",
            11 => "Zilka'de",
            12 => "Zilhicce"];

        if (!$string)
            return $date;
        else
            return "{$day}-{$hicriaylar[ $month ]}-{$year}";
    }


