    static public function parseDateStr($dateStr)
    {
        if (is_string($dateStr) && preg_match('/(\d{4})\-(\d{1,2})\-(\d{1,2})/i', $dateStr, $m)) {
            return [
                'year' => intval($m[1]),
                'month' => intval($m[2]),
                'day' => intval($m[3]),
            ];
        } else {
            return false;
        }
    }

    static public function intPart($float)
    {
        if ($float < -0.0000001)
            return ceil($float - 0.0000001);
        else
            return floor($float + 0.0000001);
    }
